import React, { Component } from 'react';

import Button from 'react-bootstrap/Button';




class Lbutton extends Component {
    render() {
      return (
        <div className="lbutton">
           <Button variant="primary" size="lg" block>
    Load PDF
  </Button>
        </div>
      );
    }
  }
  export default Lbutton;
